function replaceAndComplete(value, cant) {
    let re = /[a-zA-Z]/g;
    let numeric = value.toString().replace(re, '');
    while (numeric.length < cant) {
        numeric = '0' + numeric;
    }
    return numeric;
}

function generatePDF(invoiceData) {
    var data = backURL;
    let ratio = 918 / 1188;
    let wightImg = 614;
    let heightImg = wightImg / ratio;
    var offset = 356;
    var param = {
        orientation: "p",
        unit: "pt",
        format: "letter",
        putOnlyUsedFonts: true,
        compress: true,
        floatPrecision: 16, // or "smart", default is 16
    };
    let pdf = new jsPDF(param);
    let code = `415${invoiceData.local_code}8020${invoiceData.code}${invoiceData.invoice}${
        replaceAndComplete(invoiceData.num_doc, 10)
    }\xCF3900${replaceAndComplete(invoiceData.amount, 14)}\xCF96${invoiceData.date_end[0]}${
        invoiceData.date_end[1]
    }${invoiceData.date_end[2]}`
    let Bcontain = document.createElement("canvas");
    let BcodeIMG;
    var string;
    let Bcode = JsBarcode(Bcontain, "\xCF" + code, {
        format: "code128c",
        displayValue: "false",
    });


    BcodeIMG = Bcode._renderProperties.element.toDataURL("image/jpeg", 1);
    pdf.addImage(data, "JPEG", 0, 0, wightImg, heightImg);
    drawInvoice(pdf, invoiceData, 0);
    drawInvoice(pdf, invoiceData, offset);
    drawOthers(pdf, invoiceData, BcodeIMG);
    string = pdf.output("datauristring");
    document.getElementById("pdfFrame").setAttribute("src", string);
}